import { Component, ViewChild, ElementRef,OnInit } from '@angular/core';
import * as jsPDF from 'jspdf';
import 'jspdf-autotable';
import { UserOptions } from 'jspdf-autotable';
// import 'jspdf-customfonts'
import {  AngularFirestoreModule,  AngularFirestore} from "angularfire2/firestore";

import { UserService } from "src/app/service/user/user.service";
import { ContestDataService } from "src/app/service/contest-data.service";
import { User, Contest, Match } from "src/app/user";
import {formatDate } from '@angular/common';

interface jsPDFWithPlugin extends jsPDF{
  autotable : (options: UserOptions) => jsPDF;
}
import {
  NgForm,
  FormGroup,
  FormArray,
  FormBuilder,
  Validators,
  FormControl
} from "@angular/forms";
@Component({
  selector: 'app-reportpdf',
  templateUrl: './reportpdf.component.html',
  styleUrls: ['./reportpdf.component.css']
})
export class ReportpdfComponent {
  doc = new jsPDF('p', 'pt');
  contest: Contest[] = [];
  match:any
  today= new Date();
  jstoday = '';
  pageHeight = this.doc.internal.pageSize.height || this.doc.internal.pageSize.getHeight();
  pageWidth = this.doc.internal.pageSize.width || this.doc.internal.pageSize.getWidth();
  
  imgData = 'data:image/png;base64,'  
  constructor( private db: AngularFirestore,private _data: ContestDataService){
    this._data.getContests().subscribe((data: Contest[]) => {
      this.contest = data;
      console.log(this.contest);
    });
    this.jstoday = formatDate(this.today.toLocaleString(), 'EEEE, MMMM dd, y HH:mm:ss OOO', 'en-US', '+0700');
  }

  name = 'Angular Html To Pdf ';

  ngOnInit() {
    var x = document.getElementById("formscore");
    x.style.display = "none";
    var y = document.getElementById("formcontest");
    y.style.display = "none";
  }

  @ViewChild('pdfTable', {static: true}) pdfTable: ElementRef;

  getmatch(path){
    var match1 =[]
    var splitted = path.value.contestid.split("/")
    console.log(splitted)
    var matchdb = this.db.collection(splitted[0]).doc(splitted[1]).collection("match").snapshotChanges()
    matchdb.subscribe(a=>{
      a.map(d=>{
        
        let s = d.payload.doc.data()
        s.id = d.payload.doc.id
        s.path = d.payload.doc.ref.path
        match1.push(s)
      })
      this.match =match1
      console.log(this.match)
    })
  }

  downloadTableScore(path){
    this.doc = new jsPDF('p', 'pt')
    // document.getElementById("contentbody").appendChild(iframe)
    var splitted = path.value.matchid.split("/")
    var matchdataread
    var getscoredb = this.db.collection(splitted[0]).doc(splitted[1]).collection(splitted[2]).doc(splitted[3]).collection("player").snapshotChanges()
    var rowdata=[]
    var getdata = this.db.collection(splitted[0]).doc(splitted[1]).collection(splitted[2]).doc(splitted[3]).snapshotChanges().subscribe(matchdata=>{
      console.log(matchdataread = matchdata.payload.data())
    })
    var header=[{dd:'',id:'',name:'-',score:''}]
    getscoredb.subscribe(a=>{
      a.map(ds=>{
        let ss = {dd:ds.payload.newIndex+1,id:ds.payload.doc.data().number,name:ds.payload.doc.data().name,score:ds.payload.doc.data().score}
        // console.log(ds.payload.doc.data())
        rowdata.push(ss)
      })
      this.setfont()
      this.doc.setFontSize(30);
      this.doc.addImage(this.imgData,'PNG',15,15,50,50)
      var text = (matchdataread.name+" " +matchdataread.time+"  "+matchdataread.type)
      this.doc.text("",this.centertext(""),50)
      this.doc.text(text,this.centertext(text), 80)
      // this.doc.text("",this.centertext(""),80)
      // this.doc.text(this.centertext(mdb.payload.doc.data().name+mdb.payload.doc.data().time+""+mdb.payload.doc.data().type),110,mdb.payload.doc.data().name+mdb.payload.doc.data().time+""+mdb.payload.doc.data().type)

      this.doc.autoTable({
        startY: 140,
        head :header,
        body:rowdata
        ,styles: { font: "THSarabunNew" ,fontStyle: 'normal',fontSize: 16},columnStyles: { font: "THSarabunNew" },bodyStyles: { font: "THSarabunNew" }
        ,headStyles: { font: "THSarabunNew",fontStyle: 'normal' ,fontSize: 24},footStyles: { font: "THSarabunNew" },alternateRowStyles: { font: "THSarabunNew" }
      });
      this.doc.setFontSize(16)
      this.doc.text("1/1",this.pageWidth -30, 20)
      this.doc.text(this.jstoday,this.centertext(this.jstoday), this.pageHeight  - 10)
      console.log(rowdata)
      // var iframe = document.createElement('iframe');
      
      
      // this.doc.save('table.pdf');
      var iframe = document.createElement('iframe');
      iframe.setAttribute('style','position:absolute; top:0;bottom:0;right:0;left:0; height:100vh; width:100%');
      iframe.src = this.doc.output('bloburl')
      // window.open(this.doc.output('bloburl'), '_blank');
      // this.doc.output('dataurlnewwindow')
      document.getElementById("contentbody").appendChild(iframe)
    })
    
  }

  setfont(){
    this.doc.addFileToVFS('THSarabunNew.ttf','')

    this.doc.addFont('THSarabunNew.ttf', 'THSarabunNew', 'normal');
    this.doc.setFont('THSarabunNew')
  }

  downloadcontest(path){
    this.doc = new jsPDF('p', 'pt')
    var iframe = document.createElement('iframe');
    // var iframe = document.createElement('iframe');
    // document.getElementById("contentbody").appendChild(iframe)
    var splitted = path.value.contestdd.split("/")
    
    var rowdata=[]
    var matchdata=[]
    var contestdata
    var player=[]
    var header=[{dd:'',id:'', kainame:'',name:'-',score:''}]
    let page = 1
    let totalpage
    var getreportcontest = this.db.collection(splitted[0]).doc(splitted[1])
    getreportcontest.snapshotChanges().subscribe(contest=>{
      contestdata = contest.payload.data()
      console.log(contest.payload.data())
    })
    var getmatchincontest = getreportcontest.collection("match").snapshotChanges()
    getmatchincontest.subscribe(mdata=>{
      totalpage = mdata.length
      mdata.map(mdb=>{
        let q = {no:mdb.payload.newIndex+1,mname:mdb.payload.doc.data().name,mtime:mdb.payload.doc.data().time,mtype:mdb.payload.doc.data().type,mid:mdb.payload.doc.id}
        
        var str = mdb.payload.doc.ref.path.split("/")
        console.log(str)

        var getscoredb = this.db.collection(str[0]).doc(str[1]).collection(str[2]).doc(str[3]).collection("player").snapshotChanges()
        getscoredb.subscribe(a=>{
          a.map(ds=>{
            console.log(ds.payload.doc.data().kainame)
            let ss = {dd:ds.payload.newIndex+1,id:ds.payload.doc.data().number,name:ds.payload.doc.data().name,kainame:ds.payload.doc.data().kainame,score:ds.payload.doc.data().score}
            rowdata.push(ss)
          })

          this.setfont()
          this.doc.setFontSize(30);
          this.doc.addImage(this.imgData,'PNG',15,15,50,50)
          this.doc.text(contestdata.contestname,this.centertext(contestdata.contestname), 50)
          this.doc.text(contestdata.date,this.centertext(contestdata.date),80)
          this.doc.text(this.centertext(mdb.payload.doc.data().name+mdb.payload.doc.data().time+""+mdb.payload.doc.data().type),110,mdb.payload.doc.data().name+mdb.payload.doc.data().time+""+mdb.payload.doc.data().type)
          this.doc.autoTable({
              startY: 140,
              head :header,
              body:rowdata
              ,styles: { font: "THSarabunNew" ,fontStyle: 'normal',fontSize: 16, halign: 'center'},columnStyles: { font: "THSarabunNew" },bodyStyles: { font: "THSarabunNew" }
              ,headStyles: { font: "THSarabunNew",fontStyle: 'normal' ,fontSize: 24},footStyles: { font: "THSarabunNew" },alternateRowStyles: { font: "THSarabunNew" }
            })
            this.doc.setFontSize(16)
            this.doc.text((page).toString()+"/"+totalpage,this.pageWidth -30, 20)
            this.doc.text(this.jstoday,this.centertext(this.jstoday), this.pageHeight  - 10)
            this.doc.addPage()
            // this.doc.save(mdb.payload.doc.data().name+mdb.payload.doc.data().time+""+'.pdf')
            page++
            for(let i=rowdata.length+1;i>0;i--){
              rowdata.pop()
            }
            
            iframe.setAttribute('style','position:absolute; top:0;bottom:0;right:0;left:0; height:100vh; width:100%');
            iframe.src = this.doc.output('bloburl')
            // window.open(this.doc.output('bloburl'), '_blank');
            // this.doc.output('dataurlnewwindow')
            document.getElementById("contentbody").appendChild(iframe)
            // this.doc = new jsPDF('p', 'pt')
      })
      
    })
  })
}

  centertext(text){
    var xOffset = (this.pageWidth / 2) - (this.doc.getStringUnitWidth(text) * this.doc.internal.getFontSize() / 2);
    return xOffset
  }

  togglediv(){
    var x = document.getElementById("formscore");
    if (x.style.display === "none") {
      x.style.display = "block";
    } else {
      x.style.display = "none";
    }
  }
    togglediv2(){
      var x = document.getElementById("formcontest");
    if (x.style.display === "none") {
      x.style.display = "block";
    } else {
      x.style.display = "none";
    }
  }
}
